}

.gallery {
    margin-top: 100px;
    margin-left: 20px;
    margin-right: 20px;
    @media (min-width: 420px) {
      margin-left: 20%;
      margin-right: 20%;
    }
}

.gallery__more {
    margin-top: 30px;
    font-size: 13px;
    font-family: "OpenSans";
    display: flex;
    flex-direction: row;
    color: $text-color;
    text-decoration: none;
