    margin-top: 30px;
    font-family: "OpenSans";
    font-size: 14px;
    font-weight: 400;

    @media(min-width: 420px) {
      font-size: 20px;
    }
}

.slider {
    margin-right: 20px;

    width: 280px;
    overflow: hidden;
    position: relative;
    @media (min-width: 480px) {
      width: 60vw;

    }
  }

  .slider__slides {
    display: flex;

    transition: transform 300ms;
  }

  .slider__slide {
    width: 280px;
    height: 200px;
    object-fit: contain;
    @media (min-width: 480px) {
      width: 60vw;
      height: 400px;
    }
  }

  .slider__arrow {
    margin-top:80px;
   font-family: "OpenSans";

    transform: translateY(-50%);
    font-size: 13px;
    font-weight: 300;
    text-align: center;
    user-select: none;
    cursor: pointer;
    margin-bottom: 10px;

  }

  .slider__arrow--right {
    margin-top:30px;
  }


