    margin: 20px;
    margin-top: 100px;
}

.footer__title {
    text-align: center;
    font-family: "ProzaLibre";
    font-size: 30px;
    justify-content: center;
    margin-bottom: 30px;
    font-weight: 500;
    line-height: 110%;
